    s << indent << "moy_exists: ";
    Printer<uint8_t>::stream(s, indent + "  ", v.moy_exists);
    s << indent << "time_stamp: ";
    Printer<uint32_t>::stream(s, indent + "  ", v.time_stamp);
    s << indent << "time_stamp_exists: ";
